import React,{Component} from 'react';
import './App.css';

class App extends Component {

  constructor(props) {
      super(props);
      this.state = { count: 0 };
  }

  incrementCount = () => {
  this.setState(
          { count: this.state.count + 1 }
      );
};

  render() {
      return (
          <div onClick={ this.incrementCount }>
              Clicks: { this.state.count }
    </div>
      );
  }
}

React.render(
<App/>, 
document.body

);
export default App;
